import React from 'react'

class App extends React.Component {

	render() {
		return (
			<div style={{position: 'absolute', top: 0, right: 0, left: 0}}>
				<div style={{position: 'relative'}}>
					<div style={{height: '10vh', width: '100vw', top : 0, left: 0, right: 0, position: 'absolute', borderBottom: '0.5px solid black', display: 'flex', flexDirection: 'row', alignItems: 'center', justifyContent: 'space-evenly'}}>
						<b>Coucou</b>
						<b>Coucou</b>
						<b>Coucou</b>
					</div>
					<img
					style={{height: '50vh', width: '100vw', display: 'flex', alignItems: 'center', justifyContent: 'center', marginTop: '10vh', backgroundColor: 'red', left: 0, position: 'absolute'}}
					src={require('./Images/movers.png')}
					>
						<b>Hello</b>
					</img>
				</div>
			</div>
		);
	}
}

export default App;
